  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains three-dimensional
  mobile lidar elevation data for seven villages in American Samoa on the island of
  Tutuila. The seven villages are: Fagaalu, Fagotogo, Pago Pago, Vatia, Leone, Amanave,
  and Poloa. The data were collected by Sanborn Map Company on October 27 - 30, 2010
  Partners in this effort were the NOAA Pacific Services Center, the American Samoa
  Department of Commerce, and the National Park of American Samoa. The classifications
  available for download from the Digital Coast are: 1. Ground (2) 2. Low Vegetation
  (3) 3. Medium Vegetation (4) 4. High Vegetation (5) 5. Building (6) 6. Model Key
  Point (8) A smooth surface can be generated from model key points.\",\n\t\"owner_org\":
